import React, { useState } from "react";
import {
  Container,
  Row,
  Col,
  Form,
  Button,
  Tooltip,
  OverlayTrigger,
} from "react-bootstrap";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faClock } from "@fortawesome/free-solid-svg-icons";
import services from "../Services/dataServices";
import "../Styles/newreg.css";
const New = () => {
  const [task, setTask] = useState([]);
  const [newItem, setNewItem] = useState("");
  const [dueDate, setDueDate] = useState("");
  const [loading, setLoading] = useState(false);
  const [showDueDateMessage, setShowDueDateMessage] = useState(false);
  const [confirmation, setConfirmation] = useState(null);
  const [accomplished, setAccomplished] = useState(false);

  const handleItemChange = (e) => {
    setNewItem(e.target.value);
  };

  const handleDueDateChange = (e) => {
    setDueDate(e.target.value);
  };
  const handleAccomplished = () => {
    setAccomplished(!accomplished);
  };

  const handleItemSubmit = (e) => {
    e.preventDefault();
    try {
      const taskNew = {
        tname: newItem,
        date: dueDate,
        taccomplished: accomplished,
      };
      console.log("tak ", taskNew);
      services.postData(taskNew).then((response) => {
        setTask(task.concat(response));
        setNewItem("");
        setDueDate("");
        setAccomplished(false);
      });
      setLoading(true); // Set loading state to true
      // Simulate a loading delay (you can replace this with actual async logic)
      setTimeout(() => {
        console.log("New item:", newItem);
        console.log("Due date:", dueDate);
        setLoading(false); // Set loading state to false after handling the submission
        setNewItem("");
        setDueDate("");
      }, 2000);
    } catch (error) {
      // Simulated delay of 2 seconds
      setConfirmation(`Error submitting data. Please try again`);
      console.error("Error submitting form data:", error);
    }
  };

  const handleDueDateMouseEnter = () => {
    setShowDueDateMessage(true);
  };

  const handleDueDateMouseLeave = () => {
    setShowDueDateMessage(false);
  };

  const currentDate = new Date();
  const options = {
    weekday: "long",
    year: "numeric",
    month: "long",
    day: "numeric",
  };
  const formattedDate = currentDate.toLocaleDateString("en-US", options);

  const tooltip = <Tooltip id="due-date-tooltip">DUE DATE</Tooltip>;
  return (
    <Container className="new-container" fluid>
      <Row className="justify-content-center">
        <Col xs={12} md={6}>
          <div className="new-content">
            <h2>Create New Task</h2>
            <p>{formattedDate}</p>
            <Form onSubmit={handleItemSubmit}>
              <Row className="input-wrapper">
                <Col>
                  <Form.Control
                    type="text"
                    value={newItem}
                    onChange={handleItemChange}
                    placeholder="Enter task details"
                  />
                </Col>
                <Col xs="auto" className="position-relative">
                  <OverlayTrigger
                    placement="top"
                    overlay={tooltip}
                    show={showDueDateMessage}
                  >
                    <Form.Control
                      type="date"
                      value={dueDate}
                      onChange={handleDueDateChange}
                      onFocus={() => setShowDueDateMessage(true)}
                      onBlur={() => setShowDueDateMessage(false)}
                    />
                  </OverlayTrigger>
                </Col>
              </Row>
              <br></br>
              <br></br>
              <div className="new-contentt text-center">
                <Button type="submit">
                  {loading ? (
                    <>
                      <span>TICK-T</span>
                      <FontAwesomeIcon icon={faClock} spin />
                      <span>CK</span>
                    </>
                  ) : (
                    "Add New Task"
                  )}
                </Button>
              </div>
            </Form>
            {confirmation && <p>{confirmation}</p>}
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default New;
